import React from 'react';
import {
    Container,
    Typography,
    Box,
    Card,
    CardContent,
    Button,
    Divider,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper
} from '@mui/material';
import { styled } from '@mui/material/styles';
import RestoreIcon from '@mui/icons-material/Restore';
import DeleteIcon from '@mui/icons-material/Delete';

const StyledCard = styled(Card)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    transition: 'transform 0.2s',
    '&:hover': {
        transform: 'translateY(-2px)'
    }
}));

const SearchHistoryPage = ({ history, onRestoreSearch, onDeleteSearch, results, onViewResults }) => {
    return (
        <Container maxWidth="lg" sx={{ py: 4 }}>
            <Typography variant="h4" gutterBottom>
                Siste søk
            </Typography>
            
            {history.map((item) => (
                <StyledCard key={item.id}>
                    <CardContent>
                        <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                            <Box>
                                <Typography variant="h6">
                                    {item.course_name}
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    Søkt {new Date(item.created_at).toLocaleString('nb-NO')}
                                </Typography>
                            </Box>
                            <Box>
                                <Button
                                    startIcon={<RestoreIcon />}
                                    onClick={() => onViewResults(item)}
                                    variant="contained"
                                    sx={{ mr: 1 }}
                                >
                                    Vis resultater
                                </Button>
                                <Button
                                    startIcon={<DeleteIcon />}
                                    onClick={() => onDeleteSearch(item.id)}
                                    variant="outlined"
                                    color="error"
                                >
                                    Slett
                                </Button>
                            </Box>
                        </Box>
                        
                        {results?.id === item.id && (
                            <>
                                <Divider sx={{ my: 2 }} />
                                <TableContainer component={Paper} variant="outlined">
                                    <Table>
                                        <TableHead>
                                            <TableRow>
                                                <TableCell>Kurs</TableCell>
                                                <TableCell>Studiepoeng</TableCell>
                                                <TableCell align="right">Likhet</TableCell>
                                            </TableRow>
                                        </TableHead>
                                        <TableBody>
                                            {item.results.map((result) => (
                                                <TableRow key={result.kurskode}>
                                                    <TableCell>
                                                        <Typography variant="body2" sx={{ fontWeight: 500 }}>
                                                            {result.kurskode}
                                                        </Typography>
                                                        <Typography variant="caption" color="text.secondary">
                                                            {result.kursnavn}
                                                        </Typography>
                                                    </TableCell>
                                                    <TableCell>{result.credits}</TableCell>
                                                    <TableCell align="right">
                                                        <Typography 
                                                            variant="body2" 
                                                            sx={{ 
                                                                fontWeight: 600,
                                                                color: theme => 
                                                                    result.similarity >= 70 ? theme.palette.success.main :
                                                                    result.similarity >= 50 ? theme.palette.warning.main :
                                                                    theme.palette.error.main
                                                            }}
                                                        >
                                                            {result.similarity}%
                                                        </Typography>
                                                    </TableCell>
                                                </TableRow>
                                            ))}
                                        </TableBody>
                                    </Table>
                                </TableContainer>
                            </>
                        )}
                    </CardContent>
                </StyledCard>
            ))}
        </Container>
    );
};

export default SearchHistoryPage;
